import { Grid } from '@mui/material'
import React, { useState } from 'react'
import Extra from '../config/components/extra'
import { Rooms } from '../config/components/obj';

export default function Cardsss() {

    const [addRooms, setaddRooms] = useState(Rooms);


    return (
        <>
            <div className='maincards'>
                <h1 >Rooms</h1>
                {addRooms.map((e) => {
                    return (

                        <Grid container rowSpacing={1} columnSpacing={{ xs: 1, sm: 2, md: 3 }}>
                            <Grid item md={3}>
                                <Extra head={"4 Bedrooms"}
                                    pera={"free breakfast"}
                                    btn={"Book Now"}
                                    image={"https://cf.bstatic.com/xdata/images/hotel/max1024x768/257803292.jpg?k=78e57c0acabe8fdac0557960f051e755880276c4934436d58f1e8d26464c8ddc&o=&hp=1"} />
                            </Grid>

                        </Grid>
                    )
                })}
            </div>
        </>
    )
}
